INSERT INTO `catalog_product_entity_text` VALUES (1,85,0,1,'Thc n cho ch ANF6 Free Dog ht hu c'),(2,75,0,1,'<style>#html-body [data-pb-style=I3YMD8U]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"I3YMD8U\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">										\r\n								\r\n											&lt;h2&gt;&lt;em&gt;&lt;strong&gt;Ht cho ch Smart Heart Mother Baby Dog 15kg Thc n cho ch bu v ch s sinh - CutePets&lt;/strong&gt;&lt;/em&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Trng lng: 15Kg (Bao x nguyn 15Kg x 1 bao)&lt;br&gt;\r\nM T SN PHM&lt;br&gt;\r\n&amp;nbsp; Chm sc Cn m sau sinh l cng vic rt quan trng v mang tnh quyt nh cho sc khe ca Cn m. V vy hy lu  cc cch chm sc Cn m sau sinh tt nht nh sau:&lt;br&gt;\r\n- Khng cho Cn m n thc n tanh, nhiu m  phng dn n tiu chy, mt sa.&lt;br&gt;\r\n- Kim tra tuyn v ca Cn m hng ngy  phng mc bnh vim v (mastitis).&lt;br&gt;\r\n- a Cn m n bc s th y  kim tra nu thy dch tit m o chuyn mu t nu  sang xanh, xm.&amp;nbsp;&lt;br&gt;\r\n- Cho Cn m n SmartHeart Mother &amp;amp; Baby Dog sn phm c  cc cht dinh dng gip Cn m c nhiu sa.&lt;br&gt;\r\n&amp;nbsp; p ng nhu cu dinh dng cho s pht trin v qu trnh mang thai ca ch c quy nh bi Hip hi Thc n chn nui Hoa K AAFCO.&amp;nbsp;&lt;br&gt;\r\n&amp;nbsp; Thc n SmartHeart dnh cho ch mang thai v ch con sn xut theo tiu chun BRC-, ISO 14001 v HACCP chng nhn sn xut thc n dnh cho th cng.&amp;nbsp;&lt;br&gt;\r\nNguyn liu chnh: Bt gia cm, go, protein u tng, m g, du u tng, gluten ng, nm men sy kh, premix khong, c ci ng, du c, lecithin, gum, sa khng bo, galacto oligosaccharide, premix vitamin, cht chng oxi ha, chit xut yucca.&amp;nbsp;&lt;br&gt;\r\nThnh phn dinh dng:  m ti a (10,00% (ti a), m th 28,00%, x th 5,00% (ti a), khong tng s 10,00% (ti a), cht bo tng s 18,00% (ti thiu).&amp;nbsp;&lt;br&gt;\r\nHng dn bo qun: Lun gi sn phm cn li trong ti hoc thng kn.&amp;nbsp;&lt;br&gt;\r\nBo qun sn phm  ni kh ro, thong mt, trnh tip xc trc tip vi nh sng mt tri.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Prebiotics l nhng cht x c ngun gc t nhin gip tng s ln i ngoi ca Cn, gip ci thin cht lng phn v gim mi hi.&lt;br&gt;\r\n- H tr vi khun c li cho ng rut Lactobacillus, Bifidobacteria gip chng pht trin vt tri gip h tiu ha khe mnh.&lt;br&gt;\r\n- SmartHeart Mother &amp;amp; Baby Dog cung cp Prebiotic v cc dinh dng cn thit gip Cn m v Cn con c h tiu ha khe mnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=\"Ht cho ch Smart Heart Mother Baby Dog 15kg Thc n cho ch bu v ch s sinh - CutePets\" src=\"//bizweb.dktcdn.net/100/307/433/products/hat-cho-cho-smart-heart-mother-baby-dog-15kg-thuc-an-cho-cho-bau-va-cho-so-sinh-cutepets2.jpg?v=1646126246397\" style=\"height:720px; width:720px\"&gt;&lt;img alt=\"Ht cho ch Smart Heart Mother Baby Dog 15kg Thc n cho ch bu v ch s sinh - CutePets\" src=\"//bizweb.dktcdn.net/100/307/433/products/hat-cho-cho-smart-heart-mother-baby-dog-15kg-thuc-an-cho-cho-bau-va-cho-so-sinh-cutepets1.jpg?v=1646126246397\" style=\"height:720px; width:720px\"&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Ngy sn xut: In trn bao b&lt;br&gt;\r\n- Hn s dng: &amp;nbsp;In trn bao b&lt;br&gt;\r\n----------------------------------------------------------&lt;br&gt;\r\n- Xut x: Thi Lan&lt;br&gt;\r\n- Cng ty sn xut: TNHH Perfect Companion Group&lt;br&gt;\r\n- a ch cng ty: Bangsaothong, Samutprakam, 10570 Thailand&lt;/p&gt;\r\n\r\n&lt;p&gt;- Nh NK &amp;amp; PP: TNHH Perfect Companion Vit Nam&lt;br&gt;\r\n\r\n</div></div></div>'),(9,75,0,5,'<style>#html-body [data-pb-style=N4HMOR2]{justify-content:flex-start;display