itamin D3, Vitamin E, E1 (St), E2 (I t), E4 (ng), E5 (Mangan), E6 (Km), E8 (Selen) - Ph gia k thut: Clinoptilolite - Ph gia cm quan: Chit xut Yucca - Cht chng oxi ha.&lt;/p&gt;\r\n&lt;p&gt;*L.I.P.: Protein c  tiu ha cao.&lt;/p&gt;\r\n&lt;p&gt;&lt;img data-thumb=\"original\" src=\"//bizweb.dktcdn.net/100/307/433/products/royal-canin-poodle-adult-1-5kg-thuc-an-danh-cho-cho-lon-cutepets8.jpg?v=1622130498037\"&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;\r\nPetizen&lt;br&gt;\r\nPh Kin Th Cng&amp;nbsp;&lt;br&gt;\r\n&lt;p&gt;#Royal #Canin #Poodle &amp;nbsp;#Adult #hNi #CuGiy #ThCng&lt;/p&gt;\r\n&lt;style type=\"text/css\"&gt;\r\n&lt;/style&gt;\r\n&lt;style type=\"text/css\"&gt;\r\n&lt;/style&gt;\r\n&lt;style type=\"text/css\"&gt;\r\n&lt;/style&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(39,85,0,20,' Royal Canin Poodle Junior 1.5kg Thc n cho ch Poodle'),(40,75,0,21,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;p&gt;&lt;em&gt;&lt;strong&gt;Thc n cho ch con Smart Heart Puppy 1.5kg - V tht b v sa Beef &amp;amp; Milk Flavor&lt;/strong&gt;&lt;/em&gt;&lt;br&gt;\r\n1. THNG TIN DINH DNG:&lt;br&gt;\r\n- Ch con tri qua thi k pht trin nhanh nht  nhng nm thng u i. Bao gm cc hot ng v qu trnh tm hiu nhng thch thc mi. Mt ngun dinh dng cn bng v y  l s cn thit i vi s pht trin cho c th chng.&lt;br&gt;\r\n- Sn phm thc n dnh cho ch con SmartHeart Puppy vi cng thc p ng v tha mn nhu cu dinh dng cho ch con ca bn bng cch s dng cc thnh phn tt nht, c b sung sa, DHA, omega 3, canxi, cc cht bo v vitamin gip tng cng tr no v sc khe tim mch.&lt;br&gt;\r\n2.THNH PHN:&lt;br&gt;\r\n- Go, tht heo, u nnh, m g, bt c ci, du c, cht thay th sa, du c, DHA, omega 3&lt;br&gt;\r\n3.CNG DNG:&lt;br&gt;\r\nCng dng ca SmartHeart Puppy:&lt;br&gt;\r\n- &amp;nbsp;Tng cng pht trin tr no&lt;br&gt;\r\n- &amp;nbsp;Gip tim mch khe mnh&amp;nbsp;&lt;br&gt;\r\n- &amp;nbsp;p da, mt lng&lt;br&gt;\r\n- &amp;nbsp;Tng c